import { useAppDispatch, useAppSelector } from "../../store";
import {
  
} from "../../store/reducers/reducer";
import { IProduct } from "../../types";
import { Product } from "./Product";

export const ProductsList = () => {
  const {products, sortBy} = useAppSelector((state) => state);
  
  const dispatch = useAppDispatch();

  const handleSortByAscending = (sort: string) => {
    products.sort((a,b)=> b.price - a.price)
    
  };

  const handleSortByDescending = (sort: string) => {
    if(sort)
    products.sort((a,b)=> a.price - b.price)
  
  };

  return (
    <div>
      <button onClick={() => handleSortByAscending("asc")}>High</button>
      <button onClick={() => handleSortByDescending("desc")}>Low</button>
      {products.map((product) => (
        <Product key={product._id} product={product} />
      ))}
    </div>
  );
};
